import { useState } from 'react';
import { Box, Button, TabNav, Text, TextInput } from '@primer/react';

export function CodeSnippet() {
  const [edit, setEdit] = useState(false);
  const [hostname, setHostname] = useState('HOSTNAME');

  return (
    <Box
      sx={{
        border: '1px solid',
        borderColor: 'border.default',
        borderRadius: 2,
        alignSelf: 'flex-start',
        width: '100%',
        maxWidth: '600px',
        overflow: 'hidden',
      }}
    >
      <Box
        sx={{
          borderBottom: '1px solid',
          borderColor: 'border.default',
          p: 3,
        }}
      >
        Get label
      </Box>
      <Box
        sx={{
          pt: 2,
          px: 3,
        }}
      >
        <TabNav
          aria-label='Main'
          sx={{
            marginBottom: '-1px',
          }}
        >
          <TabNav.Link
            href='#'
            selected
            sx={{
              bg: 'transparent !important',
            }}
          >
            Home
          </TabNav.Link>
          <TabNav.Link href='#'>Documentation</TabNav.Link>
          <TabNav.Link href='#'>Support</TabNav.Link>
        </TabNav>
      </Box>
      <Box
        sx={{
          bg: 'canvas.subtle',
          borderTop: '1px solid',
          borderColor: 'border.default',
          p: 3,
          fontSize: 1,
        }}
      >
        <pre>
          <Text sx={{ color: 'danger.fg' }}>curl </Text>
          <Text sx={{ color: 'accent.fg' }}>-L</Text>
          <Text sx={{ color: 'fg.default' }}> \</Text>
          <br />
          <Text sx={{ color: 'fg.muted' }}>
            {'  '}
            <Text sx={{ color: 'accent.fg' }}>-H</Text> "Accept:
            application/vnd.github+json"{' '}
            <Text sx={{ color: 'fg.default' }}>\</Text>
          </Text>
          <br />
          <Text sx={{ color: 'fg.muted' }}>
            {'  '}
            <Text sx={{ color: 'accent.fg' }}>-H</Text> "Authorization: Bearer
            YOUR-TOKEN" <Text sx={{ color: 'fg.default' }}>\</Text>
          </Text>
          <br />
          <Text sx={{ color: 'fg.muted' }}>
            {'  '}
            <Text sx={{ color: 'accent.fg' }}>-H</Text> "X-GitHub-Api-Version:
            2022-11-28" <Text sx={{ color: 'fg.default' }}>\</Text>
          </Text>
          <br />
          <Box
            sx={{
              display: 'flex',
            }}
          >
            <Text>http(s)://</Text>
            {edit && (
              <TextInput
                type='text'
                value={hostname}
                onChange={(e) => setHostname(e.target.value)}
                p='0'
                sx={{
                  paddingLeft: '0 !important',
                  m: '0 !important',
                  minHeight: 0,
                  width: '50px',
                }}
              />
            )}
            {!edit && (
              <Text
                sx={{
                  color: 'red',
                }}
              >
                {hostname}
              </Text>
            )}
            <Text>/api/v3/repos/OWNER/REPO/commits</Text>
          </Box>
        </pre>
      </Box>
      <Button onClick={() => setEdit(!edit)}>Toggle edit</Button>
    </Box>
  );
}
